import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  const buttonStyle = {
    textDecoration: "none",
    color: "#fff",
    backgroundColor: "#007bff",
    padding: "10px 20px",
    border: "none",
    borderRadius: "5px",
    margin: "10px",
    display: "inline-block",
  };

  return (
    <div style={{ textAlign: "center", marginTop: "20px" }}>
      <h1>Home Page</h1>
      <Link to="/create" style={buttonStyle}>
        Create Shopping List
      </Link>
    </div>
  );
};

export default Home;
